import React from 'react';

import { Link } from 'react-router-dom';
import { Route, Switch } from 'react-router-dom';

export default function Landing() {
  return (
    <Switch>
      <Route exact path="/">
        <Landing />
      </Route>

      <Route exact path="/contact">
        <Contact />
      </Route>

      <Route>
        <p>Woops! Page not found.</p>
      </Route>
  </Switch>
  )
}
